import React from 'react';

const ActivityLogPage = () => {
    return (
        <div style={{ padding: "2rem" }}>
            <h1 style={{ fontSize: "24px", fontWeight: "bold", marginBottom: "1rem" }}>Activity Log</h1>
            <p>System-wide activity logs will be displayed here.</p>
        </div>
    );
};

export default ActivityLogPage;
